import React from 'react'
import {useSpring ,animated} from 'react-spring';

class App extends React.Component {


    changes() {
     one = "#000"
   }
render() {
  let one = "#ff0000"

  const two = useSpring({from:{transform:'translateX(0px)'},transform:'translateX(50px)'})
  let three = useSpring({from:{marginTop:"0px"},marginTop:"60px"})
  return(
    <div>
    <animated.h1 style={{color: one}} onClick={this.changes}>one</animated.h1>
    <animated.h1 style={two} >two</animated.h1>
    <animated.h1 style={three} >three</animated.h1>
  </div>
  )
}
}



export default App
